<script>


import param from "./param/param";
import appService from "./services/appService";


export default {
  name: 'App',
  data() {
    return {
      utilisateur: {
        username: null,
        password: null,
        id: null,
        token: null,
        role: null

      },
      titre: null,
      message: null,
      isActive: false,
      isActiveMobile: false
    }
  },
  created() {
    this.titre = param.titre;

    let utilisateurLocal = appService.getLocal();
    if (utilisateurLocal != null){
      this.utilisateur = utilisateurLocal;
      this.titre = this.utilisateur.nom
    }
  },

  watch:{
    // Observateur de routage
    $route: function(to, from){

      // S'il y a un utilisateur
      if(this.utilisateur.token != null){
        // route non autorise
        // elle n'existe pas dans le tableau des routes autorises
        if(this.menu.indexOf(to.name) == -1){
          // Redirection sur la page d'accueil
          this.$router.push('/').catch(err =>{});
          // Modale message erreur
          this.message = param.message.errAcces;
          // Ouverture modale de connexion
          $("#errorModal").modal('show');
        }
      }else{ // Si aucun utilisateur => Accueil
        console.log("pas de token redirection accueil");
        // Redirection sur la page d'accueil
        this.$router.push('/').catch(err =>{});
      }
    }
  },

  methods:{
    connect:function (){
      console.log("Connect");
      let params = new FormData();
      params.append('username', this.utilisateur.username);
      params.append('password', this.utilisateur.password);

      axios({
        method: 'post',
        url: param.auth+'token',
        data: params
      }).then(function (response){
        this.utilisateur = response.data;
        console.log("utilisateur", response.data);
        this.titre = this.utilisateur.user_display_name;

        let localValues = {
          nom :     this.utilisateur.user_display_name,
          role :    this.utilisateur.user_role[0],
          token :   this.utilisateur.token,
          id: this.utilisateur.user_id
        };
        // Svg localStorage
        appService.setLocal(localValues);

      }.bind(this))
      .catch(error=>{
        console.log("ERREUR connexion", error);

        this.message = param.message.errCnx;
      })
    },
    deconnect:function (){
      this.titre = param.titre;
      this.utilisateur ={
        username: null,
        user_role: null,
        token: null,
        id: null
      };

      appService.removeLocal();

      this.$router.push('/').catch(err=>{});
    },

    popUp:function (){
      this.isActive = true;
    },
    popOff:function (){
      this.isActive = false;
    },
    popUpMobile:function (){
      this.isActiveMobile = true
    }

    },



}

</script>

